contracts/EnergyMonitoring.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

contract EnergyMonitoring {
    address public owner;

    enum EnergyType {
        Solar,
        Wind,
        Biomass,
        Tidal
    }

    struct EnergyRecord {
        uint256 produced;
        uint256 consumed;
        uint256 timestamp;
        EnergyType energyType;
    }

    address[] public users;

    mapping(address => EnergyRecord[]) private energyRecords;
    mapping(address => uint256) public totalProduced;
    mapping(address => uint256) public totalConsumed;

    event EnergyProduced(
        address indexed producer,
        uint256 amount,
        EnergyType energyType,
        uint256 timestamp
    );
    event EnergyConsumed(
        address indexed consumer,
        uint256 amount,
        uint256 timestamp
    );
    event DataReset(address indexed user, uint256 timestamp);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    /**
     * @dev Record energy production.
     * @param producer The address of the producer.
     * @param amount The amount of energy produced (kWh).
     * @param energyType The type of energy produced.
     */
    function recordProduction(
        address producer,
        uint256 amount,
        EnergyType energyType
    ) external onlyOwner {
        require(amount > 0, "Produced amount must be greater than zero");

        totalProduced[producer] += amount;
        energyRecords[producer].push(
            EnergyRecord({
                produced: amount,
                consumed: 0,
                timestamp: block.timestamp,
                energyType: energyType
            })
        );

        emit EnergyProduced(producer, amount, energyType, block.timestamp);
    }

    /**
     * @dev Record energy consumption.
     * @param consumer The address of the consumer.
     * @param amount The amount of energy consumed (kWh).
     */
    function recordConsumption(
        address consumer,
        uint256 amount
    ) external onlyOwner {
        require(amount > 0, "Consumed amount must be greater than zero");

        totalConsumed[consumer] += amount;
        energyRecords[consumer].push(
            EnergyRecord({
                produced: 0,
                consumed: amount,
                timestamp: block.timestamp,
                energyType: EnergyType.Solar
            })
        );

        emit EnergyConsumed(consumer, amount, block.timestamp);
    }

    /**
     * @dev Get all energy records for a user.
     * @param user The address of the user.
     * @return An array of EnergyRecord structs.
     */
    function getRecords(
        address user
    ) external view returns (EnergyRecord[] memory) {
        return energyRecords[user];
    }

    /**
     * @dev Get all energy records created by all users.
     * @return An array of all EnergyRecord structs across all users.
     */
    function getAllRecords() external view returns (EnergyRecord[] memory) {
        uint256 totalRecords = 0;
        for (uint256 i = 0; i < users.length; i++) {
            totalRecords += energyRecords[users[i]].length;
        }

        EnergyRecord[] memory allRecords = new EnergyRecord[](totalRecords);
        uint256 index = 0;

        for (uint256 i = 0; i < users.length; i++) {
            EnergyRecord[] memory userRecords = energyRecords[users[i]];
            for (uint256 j = 0; j < userRecords.length; j++) {
                allRecords[index] = userRecords[j];
                index++;
            }
        }

        return allRecords;
    }

    /**
     * @dev Reset energy data for a user. Only callable by the owner.
     * @param user The address of the user whose data will be reset.
     */
    function resetData(address user) external onlyOwner {
        delete energyRecords[user];
        totalProduced[user] = 0;
        totalConsumed[user] = 0;

        emit DataReset(user, block.timestamp);
    }

    /**
     * @dev Transfer ownership of the contract.
     * @param newOwner The address of the new owner.
     */
    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "New owner cannot be zero address");
        owner = newOwner;
    }
}

contracts/EnergyTrading.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import {IEnergy} from "./IEnergy.sol";
import {EnergyMonitoring} from "./EnergyMonitoring.sol";
import {NotificationsAndSecurity} from "./NotificationsAndSecurity.sol";
import {UserManagement} from "./UserManagement.sol";

contract EnergyTrading {
    struct EnergyListing {
        address producer;
        uint256 amount;
        uint256 price;
        bool active;
    }

    uint256 public dynamicPrice;
    IEnergy public token;
    EnergyMonitoring public energyMonitoring;
    NotificationsAndSecurity public notificationsAndSecurity;
    UserManagement public userManagement;

    bool internal locked;
    address public owner;

    mapping(address => EnergyListing) public energyListings;
    mapping(address => uint256) public customerDemand;

    event EnergyListed(address indexed producer, uint256 amount, uint256 price);

    event EnergyBought(
        address indexed producer,
        address indexed consumer,
        uint256 amount,
        uint256 price
    );
    event PriceUpdated(uint256 oldPrice, uint256 newPrice);
    event DisputeInitiated(
        address indexed initiator,
        address indexed respondent,
        string reason
    );
    event DisputeResolved(uint256 indexed disputeId, string resolutionDetails);

    modifier noReentrancyGuard() {
        require(!locked, "Reentrancy is not allowed");
        locked = true;
        _;
        locked = false;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this");
        _;
    }

    modifier onlyRegisteredProducer() {
        require(
            userManagement.isRegistered(msg.sender),
            "User is not registered"
        );
        require(
            userManagement.getUserType(msg.sender) ==
                UserManagement.UserType.Producer,
            "Only producers can perform this action"
        );
        _;
    }

    modifier onlyRegisteredConsumer() {
        require(
            userManagement.isRegistered(msg.sender),
            "User is not registered"
        );
        require(
            userManagement.getUserType(msg.sender) ==
                UserManagement.UserType.Consumer,
            "Only consumers can perform this action"
        );
        _;
    }

    constructor(
        uint256 initialPrice,
        address _token,
        address _energyMonitoring,
        address _notificationsAndSecurity,
        address _userManagement
    ) {
        require(initialPrice > 0, "Initial price must be greater than zero");
        dynamicPrice = initialPrice;
        token = IEnergy(_token);
        energyMonitoring = EnergyMonitoring(_energyMonitoring);
        notificationsAndSecurity = NotificationsAndSecurity(
            _notificationsAndSecurity
        );
        userManagement = UserManagement(_userManagement);

        owner = msg.sender;
    }

    /**
     * @dev Update the dynamic price based on supply and demand.
     * Fetch total production and consumption from EnergyMonitoring.
     */

    function updatePrice() public onlyOwner {
        uint256 totalSupply = energyMonitoring.totalProduced(owner);
        uint256 totalDemand = energyMonitoring.totalConsumed(owner);

        require(totalSupply > 0, "Supply must be greater than zero");
        require(totalDemand > 0, "Demand must be greater than zero");

        uint256 oldPrice = dynamicPrice;
        dynamicPrice = (totalDemand * oldPrice) / totalSupply;

        emit PriceUpdated(oldPrice, dynamicPrice);
    }

    /**
     * @dev List energy for sale.
     * Also records production in the EnergyMonitoring contract.
     */
    function listEnergy(
        uint256 amount,
        EnergyMonitoring.EnergyType energyType
    ) public noReentrancyGuard onlyRegisteredProducer {
        require(amount > 0, "Amount must be greater than zero");
        require(
            energyListings[msg.sender].active == false,
            "Existing listing must be inactive"
        );

        // Record production.
        energyMonitoring.recordProduction(msg.sender, amount, energyType);

        energyListings[msg.sender] = EnergyListing({
            producer: msg.sender,
            amount: amount,
            price: dynamicPrice,
            active: true
        });

        emit EnergyListed(msg.sender, amount, dynamicPrice);
        notificationsAndSecurity.sendTransactionAlert(
            msg.sender,
            "Energy listed successfully"
        );
    }

    /**
     * @dev Buy energy from a producer.
     * Records consumption in the EnergyMonitoring contract.
     */
    function buyEnergy(
        address producer,
        uint256 amount
    ) public noReentrancyGuard {
        EnergyListing storage listing = energyListings[producer];

        require(listing.active, "Energy is not available for sale");
        require(
            listing.amount >= amount,
            "Producer does not have enough surplus"
        );
        require(
            customerDemand[msg.sender] >= amount,
            "Consumer demand is insufficient"
        );

        uint256 totalCost = amount * listing.price;
        require(
            token.allowance(msg.sender, address(this)) >= totalCost,
            "Allowance insufficient"
        );
        require(
            token.balanceOf(msg.sender) >= totalCost,
            "Insufficient token balance"
        );

        token.transferFrom(msg.sender, producer, totalCost);
        require(token.approve(producer, totalCost), "Approval failed");

        uint256 fee = (totalCost * 1) / 100;
        token.transferFrom(producer, owner, fee);

        listing.amount -= amount;
        if (listing.amount == 0) {
            listing.active = false;
        }

        customerDemand[msg.sender] -= amount;

        energyMonitoring.recordConsumption(msg.sender, amount);

        emit EnergyBought(producer, msg.sender, amount, listing.price);

        notificationsAndSecurity.sendPaymentAlert(
            msg.sender,
            producer,
            totalCost
        );
    }

    function initiateDispute(address respondent, string memory reason) public {
        notificationsAndSecurity.initiateDispute(respondent, reason);
        emit DisputeInitiated(msg.sender, respondent, reason);
    }

    function resolveDispute(
        uint256 disputeId,
        string memory resolutionDetails
    ) public onlyOwner {
        notificationsAndSecurity.resolveDispute(disputeId, resolutionDetails);
        emit DisputeResolved(disputeId, resolutionDetails);
    }
}

contracts/IEnergy.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

/// @title IEnergy Interface
/// @notice Defines the standard interface for an energy token, including essential ERC-20 functions.
/// @dev This interface is designed to facilitate interaction with energy-based token systems.
interface IEnergy {
    /// @notice Emitted when a transfer of tokens occurs.
    /// @param from The address from which tokens were transferred.
    /// @param to The address to which tokens were transferred.
    /// @param value The amount of tokens transferred.
    event Transfer(address indexed from, address indexed to, uint256 value);

    /// @notice Emitted when an approval is set for a spender.
    /// @param owner The address of the token owner granting the allowance.
    /// @param spender The address of the spender receiving the allowance.
    /// @param value The amount of tokens approved for spending.
    event Approval(
        address indexed owner,
        address indexed spender,
        uint256 value
    );

    /// @notice Gets the total supply of tokens in circulation.
    /// @return The total number of tokens available.
    function totalSupply() external view returns (uint256);

    /// @notice Retrieves the token balance of a specific account.
    /// @param account The address of the account to query.
    /// @return The balance of the specified account.
    function balanceOf(address account) external view returns (uint256);

    /// @notice Transfers a specified amount of tokens to a given address.
    /// @param to The address of the recipient.
    /// @param value The amount of tokens to transfer.
    /// @return A boolean indicating whether the operation succeeded.
    function transfer(address to, uint256 value) external returns (bool);

    /// @notice Gets the remaining number of tokens a spender is allowed to use on behalf of an owner.
    /// @param owner The address of the token owner.
    /// @param spender The address of the spender.
    /// @return The remaining allowance for the spender.
    function allowance(
        address owner,
        address spender
    ) external view returns (uint256);

    /// @notice Approves a spender to use a specified amount of tokens on behalf of the caller.
    /// @param spender The address authorized to spend the tokens.
    /// @param value The amount of tokens approved for spending.
    /// @return A boolean indicating whether the operation succeeded.
    function approve(address spender, uint256 value) external returns (bool);

    /// @notice Transfers tokens from one address to another, using an approved allowance.
    /// @param from The address from which tokens are to be transferred.
    /// @param to The address to which tokens are to be transferred.
    /// @param value The amount of tokens to transfer.
    /// @return A boolean indicating whether the operation succeeded.
    function transferFrom(
        address from,
        address to,
        uint256 value
    ) external returns (bool);
}

contracts/NotificationsAndSecurity.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;

contract NotificationsAndSecurity {
    address public owner;

    // Events for notifications
    event TransactionAlert(address indexed user, string message, uint256 timestamp);
    event PaymentAlert(address indexed payer, address indexed payee, uint256 amount, uint256 timestamp);
    event EnergyUsageAlert(address indexed user, uint256 energyUsed, uint256 timestamp);
    event DisputeInitiated(address indexed initiator, address indexed respondent, string reason, uint256 timestamp);
    event DisputeResolved(uint256 indexed disputeId, string resolutionDetails, uint256 timestamp);
    event AuditLog(address indexed auditor, string report, uint256 timestamp);

    // Data structures
    struct Dispute {
        address initiator;
        address respondent;
        string reason;
        string resolutionDetails;
        bool resolved;
        uint256 timestamp;
    }

    Dispute[] public disputes;

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can perform this action");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    // Notifications
    function sendTransactionAlert(address user, string memory message) public onlyOwner {
        emit TransactionAlert(user, message, block.timestamp);
    }

    function sendPaymentAlert(address payer, address payee, uint256 amount) public onlyOwner {
        emit PaymentAlert(payer, payee, amount, block.timestamp);
    }

    function sendEnergyUsageAlert(address user, uint256 energyUsed) public onlyOwner {
        emit EnergyUsageAlert(user, energyUsed, block.timestamp);
    }

    // Dispute resolution
    function initiateDispute(address respondent, string memory reason) public {
        disputes.push(Dispute({
            initiator: msg.sender,
            respondent: respondent,
            reason: reason,
            resolutionDetails: "",
            resolved: false,
            timestamp: block.timestamp
        }));
        emit DisputeInitiated(msg.sender, respondent, reason, block.timestamp);
    }

    function resolveDispute(uint256 disputeId, string memory resolutionDetails) public onlyOwner {
        require(disputeId < disputes.length, "Dispute ID does not exist");
        Dispute storage dispute = disputes[disputeId];
        require(!dispute.resolved, "Dispute already resolved");

        dispute.resolutionDetails = resolutionDetails;
        dispute.resolved = true;

        emit DisputeResolved(disputeId, resolutionDetails, block.timestamp);
    }

    // Auditing and compliance
    function logAudit(string memory report) public onlyOwner {
        emit AuditLog(msg.sender, report, block.timestamp);
    }

    // Getter for disputes
    function getDispute(uint256 disputeId) public view returns (Dispute memory) {
        require(disputeId < disputes.length, "Dispute ID does not exist");
        return disputes[disputeId];
    }

    // Security features: Ownership transfer
    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0), "New owner cannot be the zero address");
        owner = newOwner;
    }
}

contracts/UserManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

contract UserManagement {
    enum UserType { Producer, Consumer }

    struct UserProfile {
        UserType userType;
        address walletAddress;
        string name;
        string preferences;
        uint256 createdAt;
    }

    mapping(address => UserProfile) private userProfiles;
    address[] private registeredUsers;


    event UserRegistered(address indexed user, UserType userType, string name, uint256 timestamp);
    event PreferencesUpdated(address indexed user, string newPreferences, uint256 timestamp);

    modifier onlyRegistered() {
        require(isRegistered(msg.sender), "User is not registered");
        _;
    }


    function registerUser(UserType userType, string memory name, string memory preferences) external {
        require(!isRegistered(msg.sender), "User is already registered");

        userProfiles[msg.sender] = UserProfile({
            userType: userType,
            walletAddress: msg.sender,
            name: name,
            preferences: preferences,
            createdAt: block.timestamp
        });

        registeredUsers.push(msg.sender);
        emit UserRegistered(msg.sender, userType, name, block.timestamp);
    }


    function updatePreferences(string memory newPreferences) external onlyRegistered {
        userProfiles[msg.sender].preferences = newPreferences;
        emit PreferencesUpdated(msg.sender, newPreferences, block.timestamp);
    }


    function getUserProfile(address userAddress) external view onlyRegistered returns (UserProfile memory) {
        require(isRegistered(userAddress), "User not found");
        return userProfiles[userAddress];
    }

    function isRegistered(address userAddress) public view returns (bool) {
        return userProfiles[userAddress].walletAddress != address(0);
    }


    function getAllUsers() external view returns (address[] memory) {
        return registeredUsers;
    }

    function getUserType(address userAddress) external view onlyRegistered returns (UserType) {
        require(isRegistered(userAddress), "User not found");
        return userProfiles[userAddress].userType;
    }
}

